				var buttonEndY = self.button.y;
				self.button.alpha = 1;
				self.button.y = buttonStart;
				moveImageIn(self.button, {y: buttonMid}, 500, createjs.Ease.sineIn, 1250).to({y: buttonEnd}, 1000, createjs.Ease.elasticOut);
		
