				createjs.Tween.get(self.button).wait(750)
				.to({scaleX: 1.05, scaleY: 1.05}, 180, createjs.Ease.sineOut)
				.to({scaleX: 1.025, scaleY: 1.025}, 180, createjs.Ease.sineOut)
